import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import FadeTypography from './FadeTypography';
import { Link } from '@material-ui/core';
import {useSpring, config, useTransition, animated} from 'react-spring';



const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
  menuItem: {
    float: 'right',
    marginRight: 30,
    marginTop: theme.spacing(0.5),
    display: 'inline-block',
  },
}));




export default function ButtonAppBar() {

    const [showA, setShowA] = React.useState(false);


    const fadeStyles = useSpring({
        config: { ...config.stiff },
        from: { opacity: 0, size: "24px" },
        to: {
          opacity: showA ? 1 : 0
        }
      });



      //////

    const [toggle, setToggle] = React.useState(true);

    function updateBar() {
        setToggle(!toggle);
    }

    const classes = useStyles();

    return (
    <div className={classes.root}>
    <AppBar position="static" elevation={1}>
        <Toolbar>
            <Typography variant="h5" className={classes.title}>
                <Link href="/" style={{color: 'black', textDecoration: 'none'}}>
                    Sam Kirby
                </Link>
            </Typography>

            <animated.span style={fadeStyles}>
                <FadeTypography toggled={toggle} className={classes.menuItem}>
                    Experience
                </FadeTypography>
            </animated.span>

            <animated.span style={fadeStyles}>
                <FadeTypography toggled={toggle} className={classes.menuItem}>
                    Blog
                </FadeTypography>
            </animated.span>

            <animated.span style={fadeStyles}>
                <FadeTypography toggled={toggle} className={classes.menuItem}>
                    Contact
                </FadeTypography>
            </animated.span>



        <IconButton onClick={() => setShowA(val => !val)} edge="start" color="inherit" aria-label="menu">
            <MenuIcon />
        </IconButton>
        </Toolbar>
    </AppBar>
    </div>
  );
}
